import React from 'react';
import subject1 from './res/subject1.png';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div>
        <img src={subject1} className="App-logo" alt="logo" />
        </div>
      </header>
    </div>
  );
}

export default App;
